import React from "react";
import { BrowserRouter as Router, Route, Routes, useLocation } from "react-router-dom";
import Header from "./components/Header";
import TitleSection from "./components/TitleSection";
import CriteriaSection from "./components/CriteriaSection";
import AdminPage from "./Admin/AdminPage";
import LoginPage from "./components/LoginPage";
import ProtectedRoute from "./components/ProtectedRoute";


const App = () => {
    const location = useLocation();

    return (
        <div>
            {location.pathname !== "/admin" && location.pathname !== "/login" && <Header />}
            <Routes>
                <Route path="/" element={<><TitleSection /><CriteriaSection /></>} />
                <Route path="/admin" element={
                    <ProtectedRoute>
                        <AdminPage />
                    </ProtectedRoute>
                } />
                <Route path="/login" element={<LoginPage />} />
            </Routes>

            <div className="w-3">
            </div>                
        </div>
    );
}

const data = [
    {
        tittle: `card 1`,
        image: `imagem do card 1`,
        description: `descrição do card 1`,
    },
    {
        tittle: `card 2`,
        image: `imagem do card 2`,
        description: `descrição do card 2`,
    },
    {
        tittle: `card 3`,
        image: `imagem do card 3`,
        description: `descrição do card 3`,
    },
    {
        tittle: `card 4`,
        image: `imagem do card 4`,
        description: `descrição do card 4`,
    },
    {
        tittle: `card 5`,
        image: `imagem do card 5`,
        description: `descrição do card 5`,
    },
    {
        tittle: `card 6`,
        image: `imagem do card 6`,
        description: `descrição do card 6`,
    },
    {
        tittle: `card 7`,
        image: `imagem do card 7`,
        description: `descrição do card 7`,
    },
]

const AppWrapper = () => (
    <Router>
        <App />
    </Router>
);

export default AppWrapper;
